import React, { useState, useEffect } from 'react';
import './User.css';

const User = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('http://localhost:3001/api/currents'); // Update with your server URL
        if (!response.ok) {
          throw new Error('Error fetching data');
        }
        const result = await response.json();
        console.log(result);
        setData(result);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, []);


  return (
    <div style={{minWidth:'100%'}}>
      {JSON.stringify(data)}
      <table>
        <thead>
        <tr>
            <th>Base Station Name</th>
            <th>User Name</th>
            <th>Latitude</th>
            <th>Longitude</th>
            <th>Timestamp</th>
          </tr>
        </thead>
        <tbody>
          {data.map((baseStation, index) => (
            <tr key={index}>
              <td>{baseStation.baseStationName}</td>
              <td>{baseStation.users[0].username}</td>
              <td>{baseStation.users[0].latitude}</td>
              <td>{baseStation.users[0].longitude}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default User;
